import React from 'react';
import { useDispatch } from 'react-redux';
import { Link } from "react-router-dom";
import { getCountries } from  "../redux/actions"
import './LandingPage.css';

const LandingPage = () => {
    const dispatch = useDispatch();

    const handleClick = () => {
        dispatch(getCountries());
    }
   return (
        <div className="container">
            <h1 className="title">Bienvenido a un espacio dedicado a todos los paises del mundo...</h1>
           
            <p>. Buscar Países</p>
            <p>. Ordenar Países por Población y Alfabeto</p>
            <p>. Filtrar Países por Continente y Actividad Turistica</p>
            <p>. Crear una Actividad Turistica</p>
            <Link to='/home' className="link">  
              <button className="button" onClick={handleClick}>Ingresar</button>
            </Link>
        </div>
    ) 
};

export default LandingPage;
